import photo1 from "./images/photo1.jpeg"
import photo2 from "./images/photo2.jpeg"
import photo3 from "./images/photo3.jpeg"
import photo4 from "./images/photo4.jpeg"


import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';


function MyGallery() {
    const settings = {
        dots: true, // Show navigation dots
        infinite: true, // Allow infinite scrolling
        speed: 100, // Transition speed in milliseconds
        slidesToShow: 1, // Number of slides to show at a time
        slidesToScroll: 1, // Number of slides to scroll at a time
    };
    return (
        <div className="myGalleryCont">
            <div className="head">
                <h1>My Gallery</h1>
            </div>
            <div className="decorGallery">
                <div className="CircleMint"></div>
                <div className="dottedLineGal"></div>
            </div>
            <ul className="galleryPhotos">
                <li><img src={photo1} alt="photo_of_my_gallery"/></li>
                <li><img src={photo2} alt="photo_of_my_gallery"/></li> 
                <li><img src={photo3} alt="photo_of_my_gallery"/></li>
                <li><img src={photo4} alt="photo_of_my_gallery"/></li>
            </ul>
        </div>
    )
}


export default MyGallery;
